                <Card photo={test_card[0]} info={test_card[1]} price={test_card[2]} />
                        </Animator>
                    </ScrollPage>
                    <ScrollPage>
                    </ScrollPage>
                </ScrollContainer>

            </div>
        </div>
    );
}

export default Products;
